const INTITAL_STATE = {
    subtotal:0,
    totalEnvio:0,
    zona:null,
    idMedioPago:null,
    tipoEnvio:null,
    cantidad:0,
    productos:[],
    total:0
}

const ventaReducer = (state=INTITAL_STATE,action)=>{
    switch (action.type) {
        default:
            return state;
    }
}

export default ventaReducer;
